import React from 'react';
import { Container } from '@mui/material';
import Box from '@mui/material/Box';
import Divider from '@mui/material/Divider';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';

const Welcome = ({ nextStep }) => {
    return (
        console.log('Welcome'),
        <Container>
            <Box sx={{ bgcolor: 'green' }}>
                <Typography variant="body1" gutterBottom>
                    In this assessment, we will ask you a series of questions to determine how well your organization is doing with Agile.
                </Typography>
                <Divider />
                <Button variant="contained" color="primary" type="button" onClick={nextStep}>
                    Start the Assessment
                </Button>
            </Box>
        </Container>
    );
};
export default Welcome;
